--
-- Table structure for table `t_mgr_sys_resource`
--

DROP TABLE IF EXISTS `t_mgr_sys_resource`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `t_mgr_sys_resource` (
  `resourceId` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(50) DEFAULT NULL COMMENT '资源名称',
  `title` varchar(50) DEFAULT NULL COMMENT '资源标题',
  `jump` varchar(200) DEFAULT NULL COMMENT '跳转URL',
  `permName` varchar(500) DEFAULT NULL COMMENT '授权名,以ROLE_开头,如ROLE_MCH',
  `permUrl` varchar(500) DEFAULT NULL COMMENT '授权URL,如:mch_info/**',
  `type` tinyint(4) DEFAULT '1' COMMENT '资源类型 1：菜单, 2：按钮',
  `system` tinyint(4) DEFAULT '1' COMMENT '所属系统 1：运营平台, 2：商户平台, 3:代理商系统',
  `icon` varchar(50) DEFAULT NULL COMMENT '菜单图标',
  `orderNum` int(11) DEFAULT NULL COMMENT '排序',
  `parentId` bigint(20) DEFAULT '0' COMMENT '父资源ID，一级为0',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态 0：禁用, 1：正常',
  `property` varchar(50) DEFAULT '' COMMENT '属性,为空都可见.否则对应商户类型,如1 表示平台账户可见, 1,2 表示平台账户和私有账户都可见',
  `createTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `updateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  PRIMARY KEY (`resourceId`)
) ENGINE=InnoDB AUTO_INCREMENT=131 DEFAULT CHARSET=utf8 COMMENT='资源表';
/*!40101 SET character_set_client = @saved_cs_client */;

